import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let posts = [
    {id: 1, message: 'Hi, how are you', likesCount: 12},
    {id: 2, message: 'It\'s my first post', likesCount: 11}
]

ReactDOM.render(
 /* <React.StrictMode>*/
